import React from 'react';
import classes from './Productcategory.module.css';
import { Row, Col, Container } from 'react-bootstrap';

import demo1 from '../../assets/images/AORUS3080Ti12G.png';
import demo2 from '../../assets/images/gigmonitor.png';
import demo3 from '../../assets/images/mb.png';
import demo4 from '../../assets/images/laptop.png';

function Productcategory() {

    return (

        <Container className={classes.ProductcategoryStyle}>

                <Row className={classes.GridRowStyle}>
                    <Col className={classes.GridColStyle}>

                        <img  className={classes.GridImageStyle} src={demo1} /> </Col>

                    <Col className={classes.GridColStyle}> 

                        <img  className={classes.GridImageStyle} src={demo2}  /> </Col>

                </Row>


                <Row className={classes.GridRowStyle}>
                    <Col className={classes.GridColStyle}>

                        <img  className={classes.GridImageStyle} src={demo3} /> </Col>

                    <Col className={classes.GridColStyle}> 

                        <img  className={classes.GridImageStyle} src={demo4}  /> </Col>

                </Row>

                <Row className={classes.GridRowStyle}>
                    <Col className={classes.GridColStyle}>

                        <img  className={classes.GridImageStyle} src={demo1} /> </Col>

                    <Col className={classes.GridColStyle}> 

                        <img  className={classes.GridImageStyle} src={demo2}  /> </Col>

                </Row>

        </Container>
    )
}

export default Productcategory;
